import React from 'react';

const NavbarContainer = styled.nav`
    width: 100%;
    padding: 20px 30px;
    box-sizing: border-box;
    position: fixed;
    z-index: 9999;
    background-color: #fff;
    box-shadow: 0.5px 0.5px 5px gray;
`;
const Navbar = () => {
  return (
    <div>
        <div id="top">
        <div id="title">
            <a href="#">Gourmet au Catering</a>
            <div id="top_menu">
                <a href="#section1" id="go_about">About</a>
                <a href="#section2" id="go_menu">Menu</a>
                <a href="#section3" id="go_contact">Contact</a>
            </div>
        </div>
    </div>
    </div>
  );
};

export default Navbar;
